import React, {Component} from 'react'

export default class Details extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className='container'>
                <h2 className='detail-title'>iPhone 7 Plus 32GB</h2>
                <div className='details-content'>
                <img style={{height: '300px', marginTop: '20px'}} src='https://cdn.tgdd.vn/Products/Images/42/78124/iphone-7-plus-gold-400x460.png'/>
                <div>
                    Prince : $300
                    <p>Những kẻ yêu công nghệ từng đi qua kỷ nguyên huy hoàng nhất của PC chắc chắn sẽ không thể quên được cụm từ "Wintel". Những chiếc máy tính dùng chip Pentium của Intel và cài đặt hệ điều hành Windows của Microsoft đã từng là bộ đôi đại diện cho những gì tân tiến nhất, phổ biến nhất, đáng mơ ước nhất của thế giới công nghệ. Cho đến trước khi smartphone và tablet lật đổ PC để trở thành danh mục sản phẩm "hot" nhất, Microsoft và Intel đã từng là bộ đôi quyền lực nhất của thế giới công nghệ.</p>
                </div>
                <div>
                    <p>thông số kĩ thuật: </p>
                <ul>
                    <li>thích thì mua chứ nhức cái gì nữa </li>
                </ul>
                </div>
                </div>
            </div>
        )
    }
}
